import React from 'react';
import ClassNames from 'classnames';

import SvgIcon from '@'

import './Button.scss';

const Button = ({ href, text, icon, classes }) => {
  return (
    <a href={href} className={classes ? ClassNames('btn', ...classes) : 'btn'}>
      {text}
      <SvgIcon></SvgIcon>
    </a>
  )
}

export default Button;
